import "../meio/meio.css";

function Meio({ dados }) {
  if (!dados) {
    return <div></div>;
  }

  return (
    <div className="meio">
      <pre>{JSON.stringify(dados, null, 2)}</pre>
    </div>
  );
}

export default Meio;
